	  const submit = (e: React.MouseEvent<HTMLButtonElement, MouseEvent>) => {
		  e.preventDefault();
		  props.dele(tweets, i);
	  };

  for(var i = 0; i < tweets.length;i++) {
	  return(
		<form style={{ display: "flex", flexDirection: "column" }}>
		  <label> {props.tweets[i]} </label>
		  <button onClick = {submit}> Delete </button>
		</form>
	  );
  };
};

